import React, { Fragment, Component } from 'react';
import './App.css';

// Function turned into a class.  Extends component class
class App extends Component {
  render() {
    return (
      // Looks like html but actually JSX (Javascript Syntax Extension)
      // Uses JSX className attribute instead of html class attribute
      // Must have only one parent element
      <Fragment>
        <h1>Hello from React</h1>
      </Fragment>
    );
  }
}

export default App;
